import styles from "./LeftSideBar.module.css"
import LogoGitHubLigth from "../../Assets/Logo/LogoGitHubLight.png"
import LogoGitHubDark from "../../Assets/Logo/LogoGitHubDark.png"
import LogoMailLigth from "../../Assets/Logo/LogoMailLight.png"
import LogoLinkedinLight from "../../Assets/Logo/LogoLinkedinLight.png"
import {motion} from 'framer-motion'
import { useSelector } from "react-redux"

function LeftSideBar() {
    const Dark = useSelector((state)=>state.dark)
    const containerVariants={
        hidden:{x:-100},
        visible:{x:0,
        transition:{
            duration:1
        }}
    }

  return (
    <motion.div 
    className={styles.Container}
    initial= "hidden"
    animate="visible"
    variants={containerVariants}>
        <a href="https://www.linkedin.com/in/riera-andres9/" target="_blank" rel="noopener noreferrer"><img src={LogoLinkedinLight} alt=""></img></a>
        <a href="https://github.com/RieraAndres" target="_blank" rel="noopener noreferrer"><img src={LogoGitHubLigth} alt=""></img></a>
        <a href="mailto:andresriera9999@gmail.com" target="_blank" rel="noopener noreferrer"><img src={LogoMailLigth} alt=""></img></a>
    </motion.div>
  );
}

export default LeftSideBar;
